import React from 'react'

const Message = (props) => {
    
    const message = "porco dio";
    const successful = false;
    return (
        <div>
        {message && (
            <div className="form-group">
              <div
                className={ successful ? "alert alert-success" : "alert alert-danger" }
                role="alert"
              >
                {message}
              </div>
            </div>
          )}
          </div>
    )
}

export default Message;
